void draw_obstacle(struct obstacle object, int obst_id){
    if (obst_id == object.id && object.pass == 1){
        for (int j = object.y; j < object.y + object.dim_y; j++){
            for (int i = object.x; i < object.x + object.dim_x; i++){
                int color_of_pixel =  object.image[(j - object.y)*object.dim_x + (i - object.x)];
				if(i < 319 && j < 239 && i > 0 && j > 0)
                	plot_pixel(i, j, convert_to_32_bits(color_of_pixel));
            }
        }
    }
}

void clear_obstacle(struct obstacle object, int obst_id){
    if (obst_id == object.id){
        for (int j = object.y; j <= object.y + object.dim_y + 1; j++){
            for (int i = object.x; i <= object.x + object.dim_x + 1; i++){
                plot_pixel(i, j, WHITE);
            }
        }
    }
}

void update_obst_id(int* obst_id){
    struct obstacle* temp = &(obstacles_list[*obst_id]);
    if (temp->x + temp->dim_x > 1 && temp->pass == 1){
        temp->x -= 2;
    }
    else{
        *obst_id += 1;
    }
}

void collision_check(int obst_id, int mode){
    struct obstacle* temp = &(obstacles_list[obst_id]);
    if (mode == 4){
        if ((temp->x < player_duck_x + player_duck_dimx) && (temp->x + temp->dim_x > player_duck_x) && (temp->y < player_duck_y + player_duck_dimy) && (temp->y + temp->dim_y > player_duck_y)){
            temp->pass = 0;
			printf("Duck collide\n");
        }
    }
    else if((temp->x < player_x + player_dim_x) && (temp->x + temp->dim_x > player_x) && (temp->y < player_y + player_dim_y) && (temp->y + temp->dim_y > player_y)){
        temp->pass = 0;
		printf("Normal collide\n");
    }
}

